import React from 'react';
import './App.css';
import { Cards } from './Cards';

import { Container, Col, Row } from 'react-bootstrap';
import 'react-bootstrap';

export const Home = () => {
  return (
    <div className="App-main">
      <Container>
        <p>This is home</p>
        <Row>
          <Col xs lg="4">
            <Cards name="Palace" loc="Clare" />
          </Col>
          <Col xs lg="8">
            <Cards name="Dicies" loc="Dublin" />
          </Col>
          <Col xs lg="4">
            <Cards name="Coppers" loc="Dublin" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
